import { Button, StyleSheet, Text, View } from 'react-native';

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
    },

    box: {
        width: '80%',
        height: 150,
        backgroundColor: 'red',
        alignSelf: 'center',
        borderRadius: 9
    }
});

export { styles };
